			imgSrc : './images/banner1.jpg'
		},
		{
			id:2,
			imgSrc : './images/banner2.png'
		},
		{
			id:3,
			imgSrc : './images/banner3.png'
		},
		{
			id:4,
			imgSrc : './images/banner4.png'
		},
		{
			id:5,
			imgSrc : './images/banner5.png'
		}
	],
	listItem: []
});
export default (state = defaultState, action) => {
	switch (action.type){
		case actionTypes.INIT_LIST:
	}

	return state;
}
